export function Validate(endpoint) {
	return endpoint.interface === 1;
}

function StreamPacket(packetId, RGBData){
	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x56;
	packet[2] = 0x83;
	packet[3] = packetId;
	//packet[4] = 0x00;
	packet = packet.concat(RGBData);
	device.write(packet, 65);

	//device.read(packet,65);

}

